import React from 'react';
import PopupCard from "./PopupCard";

const PopUpTest = () => {
    return (
        <div>
            {isOpen && (
                <PopupCard
                    title="추천 도착!"
                    description="지금 추천하면 포인트가 쌓여요!"
                    actions={[
                        {
                            label: '추천하기',
                            onClick: () => {
                                console.log('추천 완료');
                                setIsOpen(false);
                            },
                        },
                        {
                            label: '닫기',
                            onClick: () => setIsOpen(false),
                            type: 'gray',
                        },
                    ]}
                    onClose={() => setIsOpen(false)} // 배경 눌러서 닫기
                />
            )}
        </div>
    );
};

export default PopUpTest;
